import React from "react";
import "./forminput.scss";

function Forminput({handleChange ,label , ...otherprops }) {
    return (
        <div className="group">
           <input
            className="form-input" onChange={handleChange} {...otherprops}
             onChange={handleChange}
           /> 
        </div>
    )
}

export default forminput
